/*
Given a 2D grid, each cell is either a wall 'W', an enemy 'E' or empty '0' (the number zero), return the maximum enemies you can kill using one bomb.
The bomb kills all the enemies in the same row and column from the planted point until it hits the wall since the wall is too strong to be destroyed.
Note that you can only put the bomb at an empty cell.

Example:
For the given grid

0 E 0 0
E 0 W E
0 E 0 0

return 3. (Placing a bomb at (1,1) kills 3 enemies)
*/

/*
["0E00","E0WE","0E00"]
["0E00","E0EE","0E00"]
[[]]
[]
["","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""]
*/

int maxKilledEnemies(vector<vector<char>>& grid) {
	if (grid.size() == 0)
		return 0;

	if (grid[0].size() == 0)
		return 0;

	int maxRow = grid.size();
	int maxCol = grid[0].size();

	int maxEnemy = 0;

	for (int i = 0; i < grid.size(); i++) // row
	{
		for (int j = 0; j < grid[0].size(); j++) // element in row
		{
			if (grid[i][j] != '0')
				continue;

			int currEnemy = 0;

			// go up
			for (int k = i - 1; k >= 0; k--)
			{
				if (grid[k][j] == 'W')
					break;
				else if (grid[k][j] == 'E')
					currEnemy++;
			}

			// go down
			for (int k = i + 1; k < maxRow; k++)
			{
				if (grid[k][j] == 'W')
					break;
				else if (grid[k][j] == 'E')
					currEnemy++;
			}

			// go left
			for (int k = j - 1; k >= 0; k--)
			{
				if (grid[i][k] == 'W')
					break;
				else if (grid[i][k] == 'E')
					currEnemy++;
			}

			// go right
			for (int k = j + 1; k < maxCol; k++)
			{
				if (grid[i][k] == 'W')
					break;
				else if (grid[i][k] == 'E')
					currEnemy++;
			}

			maxEnemy = max(maxEnemy, currEnemy);
		}
	}

	return maxEnemy;
}